<div class="textwrapper"><textarea placeholder="Write a comment..." oninput="this.innerHTML = this.value;pybridge._add_comment(this.parentNode.parentNode.id, this.value);" style="margin: 0px; height: 142px; width: 1071px;">This dataset consists of animals in a zoo and its various attributes. Here in this project the venomous nature and if they can be domestic. Type,predator,domestic,catsize and venomous are the features selected from the 16 provided.To determine the venomous probability the type of animal is of utmost importance and then followed by being a predator or not,can or not be a domestic animal and the last being its size. Through this report we can summerise that fish which are domestic and predators in nature have a 25% probability of being venomous.But with the increase in size to catsize its probability dropped down to 16%. Also, when the type is changed to birds- being predators and non-domestic have only 7% of being venomous if in catsize and only 5% if not catsized.Catsize seems to be of little influence in determining the probability. Reptiles which are predators with catsize=1 have a 81% probability of being non-venomous compared to reptiles which are not predators and non-domestic with 90% probability of being non-venomous. The domestic nature happens to have a considerable amount of effect on the probability calculation.</textarea></div></div></body></html>
